import React from 'react';
import './navbar.css';

const Navbar = () => {
	return(
		<div className='navbar'>
			
			<h3> Home </h3>
			<h3> Bio </h3>
			<h3> Contact </h3>
			<h3> Log In </h3>
			
		</div>
		);

}

export default Navbar;
